import React from 'react';
import PropTypes from 'prop-types';
import 'antd/dist/antd.css';

const App = ({ Component }) => {
  return (
    <>
      <Component />
    </>
  )
}

// props 점검, 서비스의 안정 높히기 위해
App.propTypes = {
  Component: PropTypes.elementType.isRequired,
}

export default App;
